import React from 'react';

import './styles/Character.css';
import confLogo from '../images/character-header.svg';
import Avatar from './Avatar';

class Character extends React.Component {
  render() {
    return (
      <div className="Character">
        <div className="Character__header">
          <img src={confLogo} alt="Logo de la conferencia" />
        </div>

        <div className="Character__section-name">
          <Avatar className="Character__avatar" email={this.props.email} />
          <h1>
            {this.props.firstName} <br /> {this.props.lastName}
          </h1>
        </div>

        <div className="Character__section-info">
          <h3>{this.props.jobTitle}</h3>
          <div>@{this.props.twitter}</div>
        </div>

        <div className="Character__footer">#platziconf</div>
      </div>
    );
  }
}

export default Character;
